import React from 'react';

const url = '';


const SessionDetail = ({match}) => {

    const fetchDeatils = () => {
        fetch(url)
            .then(data => {
                return data.json();
            }) 
            .then(json => {
                console.log(json);
            })
    }

    return (
        <div>
            <h1>{match.params.id}</h1>
        </div>
    );
}

export default SessionDetail;
